        //do nothing yet
    }

    return(
        <div className="server-thumbnail-wrapper w-90 m-2 border border-secondary row" onClick={clickedThumbnail}>
            <div className="col my-auto">
                <img className="server-thumbnail-image" src={props.thumbnailDataId ? `http://localhost:5000/files/image/${props.thumbnailDataId}` : `${process.env.PUBLIC_URL}/images/user_default.png`}/>
